let img; // variable to hold the image
let saturation = 100; // initial saturation value

function preload() {
  img = loadImage(''); // replace with your own image file path
}

function setup() {
  createCanvas(img.width, img.height);
  colorMode(HSL, 360, 100, 100); // set color mode to HSL
  imageMode(CENTER); // set image mode to CENTER
}

function draw() {
  background(220);
  tint(360, saturation, 100); // set tint with current saturation value
  image(img, width/2, height/2); // draw image at center of canvas
}

function mouseMoved() {
  // reduce saturation value when mouse is over the canvas
  saturation = map(mouseX, 0, width, 0, 100);
}

function mouseExited() {
  // reset saturation value when mouse leaves the canvas
  saturation = 100;
}
